import React from "react";
import Styles from "./UI/styles.module.css";
import { Button } from "../../shared/Button/Button";

export function AuthWindow() {
	return(
		<div className = {Styles.container}>
				<form id="formAuth" className = {Styles.form}>
					<h2 className={Styles.formAuthWindowH2}>Войдите в аккаунт</h2>
					<label></label>
					<input/>
					<input/>
					<div>
						<label htmlFor="buttonNoAccount">Нет аккаунта?</label>
						<Button id="buttonNoAccount" type={0}>Зарегистрируйтесь</Button>
						<Button type={1}>Войти</Button>
					</div>
				</form>
		</div>
	);
}
